import pytest
from handlers.image_classifier_handlers import *
from ImageClassifier.image_classifier import ImageClassifier
from server_utils import Req, Res


class TestImageClassifierHandlers:
    def test_predict_without_training(self, black_image_string):
        """
        tests the predict function without training the model
        should return a prediction of -1
        """
        frame_bytes = black_image_string
        width = 320
        height = 180
        msg = {"frame": frame_bytes, "width": width, "height": height}
        event = "predict_image_classifier"
        req = Req()
        req.msg = msg
        req.event = event
        res = Res()
        image_classifier.model_category = 1
        image_classifier.classical_model_type = 1
        image_classifier.feature_extraction_type_img = 1
        image_classifier.num_classes = 2
        # Call your function
        result = predict_image_classifier(req, res)

        # Assert that the result is as expected
        assert result == {"event": event, "prediction": str(-1)}
        print("Predict without training test passed")

    def test_predict_with_training(self, black_image_string, mocker):
        """
        tests the predict function without training the model
        should return a prediction of 0
        """
        mocker.patch.object(ImageClassifier, "predict").return_value = str(0)

        frame_bytes = black_image_string
        width = 320
        height = 180
        msg = {"frame": frame_bytes, "width": width, "height": height}
        event = "predict_hand_pose"
        req = Req()
        req.msg = msg
        req.event = event
        res = Res()
        image_classifier.model_category = 1
        image_classifier.classical_model_type = 1
        image_classifier.feature_extraction_type_img = 1
        image_classifier.num_classes = 2
        image_classifier.set_model_category()
        image_classifier.create_model()

        # Call your function
        result = predict_image_classifier(req, res)

        # Assert that the result is as expected
        assert result == {"event": event, "prediction": str(0)}
        print("Predict with training test passed")

